import React, { useEffect } from 'react';
import { useSelector } from 'react-redux';
import './CritterGrid.css';
import { Critter } from '../Critter/Critter';

export const CritterGrid = (props) => {

    const month = useSelector((state) => state.month.month);
    const hour = useSelector((state) => state.hour.hour);

    const filterData = (data) => {
        data = data.filter(f => f.availability["month-array-northern"].includes(month));
        data = data.filter(f => f.availability["time-array"].includes(hour));
        console.log('filtered data: ', data);
        return data;
    }

    return(
        <div>
        <table>
            {filterData(props.data).map(critter => <tr><Critter label={critter.name["name-USen"]} imgUri = {critter["image_uri"]} /></tr>)}
        </table>
        </div>
    )
}
